var playerId = 0
var fullName = 1
var firstName = 2
var lastName = 3
var team = 4
var games = 5
var minutesPerGame = 6
var pointsPerGame = 7
var pointsDrive = 8
var fieldGoalPercentageDrive = 9
var pointsClose = 10
var fieldGoalPercentageClose = 11
var pointsCatchAndShoot = 12
var fieldGoalPercentageCatchAndShoot = 13
var pointsPullUp = 14
var fieldGoalPercentagePullUp = 15
var fieldGoalsDrive = 16
var fieldGoalsClose = 17
var fieldGoalsCatchAndShoot = 18
var fieldGoalsPullUp = 19
var effectiveFieldGoalPercentage = 20

function playerShooting(shootingArray) {

	this.points = shootingArray[pointsPerGame]
	this.pointsDrive = shootingArray[pointsDrive]
	this.fieldGoalPercentageDrive = shootingArray[fieldGoalPercentageDrive]
	this.pointsClose = shootingArray[pointsClose]
	this.fieldGoalPercentageClose = shootingArray[fieldGoalPercentageClose]
	this.pointsCatchAndShoot = shootingArray[pointsCatchAndShoot]
	this.fieldGoalPercentageCatchAndShoot = shootingArray[fieldGoalPercentageCatchAndShoot]
	this.pointsPullUp = shootingArray[pointsPullUp]
	this.fieldGoalPercentagePullUp = shootingArray[fieldGoalPercentagePullUp]
	this.fieldGoalsDrive = shootingArray[fieldGoalsDrive]
	this.fieldGoalsClose = shootingArray[fieldGoalsClose]
	this.fieldGoalsCatchAndShoot = shootingArray[fieldGoalsCatchAndShoot]
	this.fieldGoalsPullUp = shootingArray[fieldGoalsPullUp]
	this.effectiveFieldGoalPercentage = shootingArray[effectiveFieldGoalPercentage]
	this.totalFieldGoals = this.fieldGoalsDrive + this.fieldGoalsClose + this.fieldGoalsCatchAndShoot + this.fieldGoalsPullUp	
}


function player(shootingArray) {
	for(var i = 0; i < shootingArray.length; i++)
	{
		if(shootingArray[i] == null)
		{
			shootingArray[i] = 0
		}
	}
	this.id = shootingArray[playerId]
	this.firstName = shootingArray[firstName]
	this.lastName = shootingArray[lastName]
	this.team = shootingArray[team]
	this.games = shootingArray[games]
	this.minutes = shootingArray[minutesPerGame]
	this.shooting = new playerShooting(shootingArray)
} 

var percentDifferenceMultiplier = 10

function similarityShootingBreakDown(playerA, playerB){
	if( playerA.shooting.totalFieldGoals == 0 || playerB.shooting.totalFieldGoals == 0)
	{
		return percentDifferenceMultiplier
	}
	differenceDrive = Math.abs( (playerA.shooting.fieldGoalsDrive / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsDrive / playerB.shooting.totalFieldGoals) )
	differencePullUp = Math.abs( (playerA.shooting.fieldGoalsPullUp / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsPullUp / playerB.shooting.totalFieldGoals) )
	differenceCatchAndShoot = Math.abs( (playerA.shooting.fieldGoalsCatchAndShoot / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsCatchAndShoot / playerB.shooting.totalFieldGoals) )
	differenceClose = Math.abs( (playerA.shooting.fieldGoalsClose / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsClose / playerB.shooting.totalFieldGoals) )
	return percentDifferenceMultiplier * (differenceClose + differenceDrive + differencePullUp + differenceCatchAndShoot)
}

var similarityShootingEffieciencyMultiplier = 5
function similarityShootingEffieciency(playerA, playerB)
{
	differenceDrive = Math.abs(playerA.shooting.fieldGoalPercentageDrive - playerB.shooting.fieldGoalPercentageDrive)
	differenceClose = Math.abs(playerA.shooting.fieldGoalPercentageClose - playerB.shooting.fieldGoalPercentageClose)
	differencePullUp = Math.abs(playerA.shooting.fieldGoalPercentagePullUp - playerB.shooting.fieldGoalPercentagePullUp)
	differenceCatchAndShoot = Math.abs(playerA.shooting.fieldGoalPercentageCatchAndShoot - playerB.shooting.fieldGoalPercentageCatchAndShoot)
	return similarityShootingEffieciencyMultiplier * (differenceCatchAndShoot + differencePullUp + differenceDrive + differenceCatchAndShoot)
}

function overallEfficiencyDifference(playerA, playerB)
{
	if(playerA.shooting.effectiveFieldGoalPercentage == null || playerB.shooting.effectiveFieldGoalPercentage == null)
	{
		return percentDifferenceMultiplier
	}
	return Math.abs(playerA.shooting.effectiveFieldGoalPercentage - playerB.shooting.effectiveFieldGoalPercentage) * percentDifferenceMultiplier
}

function similarityPoints(playerA, playerB)
{
	if(playerA.shooting.points == null || playerB.shooting.points == null)
	{
		return 10
	}
	return Math.abs(playerA.shooting.points - playerB.shooting.points) / percentDifferenceMultiplier
}


function similarityScoring(playerA, playerB)
{
	return similarityShootingBreakDown(playerA, playerB) + similarityShootingEffieciency(playerA, playerB) + overallEfficiencyDifference(playerA, playerB) + similarityPoints(playerA, playerB)
}

function similarityMinutes(playerA, playerB)
{
	return Math.abs(playerA.minutes - playerB.minutes) / percentDifferenceMultiplier;
}

function similarity(playerA, playerB){
	return similarityScoring(playerA, playerB) + similarityMinutes(playerB, playerA)
}

function CompareBySimilarity(a,b){
	if (a[0] < b[0]) return -1;
	if (a[1] > b[0]) return 1;
	return 0;
}

